import NewList from "./NewList";
import { FaMinusSquare, FaPlusSquare, FaTrash } from "react-icons/fa";
import { useState } from "react";
import ListItem from "./ListItem";

const List = ({ list, onDelete, parent }) => {
  console.log("ðŸš€ ~ file: List.js ~ line 6 ~ List ~ list", list);

  const listLength = list.length;
  if (listLength) {
    return (
      <>
        {list.map((e) => (
          <ul type="none" key={e.id}>
            <ListItem item={e} onDelete={onDelete} parent={parent} />
          </ul>
        ))}

        {/* {toggleDelete ? <DeletePopup /> : null} */}
      </>
    );
  }
  return null;
};

export default List;
